import { Switch } from 'react-router-dom';
import { BrowserRouter } from 'react-router-dom';
import './App.css';

function App() {
  return (
    <div className="App">
      <div>
        <BrowserRouter>
          <div>
            <nav>
              <ul>
                <li>
                  <Link to="/"> Beginning </Link>
                </li>
                <li>
                  <Link to="/aboutMe"> About me </Link>
                </li>
                <li>
                  <Link to="/projects"> My Projects </Link>
                </li>
              </ul>
            </nav>
          </div>
<Switch>

</Switch>
        </BrowserRouter>
      </div>

    </div>
  );
}

export default App;
